import React from "react";

interface Entity {
    id: number;
    name: string;
}

interface Props {
    entities: Entity[];
}

const TaskArea: React.FC<Props> = ({ entities }) => (
    <ul>
        {entities.map((entity) => (
            <li key={entity.id}>{entity.name}</li>
        ))}
    </ul>
);

export default TaskArea;
